INSERT INTO `Script` VALUES (1,'어린왕자','Once when I was six years old I saw a magnificent picture in a book, called True Stories from Nature, about the primeval forest. It was a picture of a boa constrictor in the act of swallowing an animal. Here is a copy of the drawing. \nIn the book it said: \"Boa constrictors swallow their prey whole, without chewing it. After that they are not able to move, and they sleep through the six months that they need for digestion.\" \n\nI pondered deeply, then, over the adventures of the jungle. And after some work with a colored pencil I succeeded in making my first drawing. My Drawing Number One. It looked like this: I showed my masterpiece to the grown-ups, and asked them whether the drawing frightened them.\n\nBut they answered: \"Frighten? Why should any one be frightened by a hat?\"\n\nMy drawing was not a picture of a hat. It was a picture of a boa constrictor digesting an elephant. But since the grown-ups were not able to understand it, I made another drawing: I drew the inside of the boa constrictor, so that the grown-ups could see it clearly. They always need to have things explained. My Drawing Number Two looked like this:\n\nThe grown-ups\' response, this time, was to advise me to lay aside my drawings of boa constrictors, whether from the inside or the outside, and devote myself instead to geography, history, arithmetic and grammar. That is why, at the age of six, I gave up what might have been a magnificent career as a painter. I had been disheartened by the failure of my Drawing Number One and my Drawing Number Two. Grown-ups never understand anything by themselves, and it is tiresome for children to be always and forever explaining things to them.\n\nSo then I chose another profession, and learned to pilot airplanes. I have flown a little over all parts of the world; and it is true that geography has been very useful to me. At a glance I can distinguish China from Arizona. If one gets lost in the night, such knowledge is valuable.\n\nIn the course of this life I have had a great many encounters with a great many people who have been concerned with matters of consequence. I have lived a great deal among grown-ups. I have seen them intimately, close at hand. And that hasn\'t much improved my opinion of them.\n\nWhenever I met one of them who seemed to me at all clear-sighted, I tried the experiment of showing him my Drawing Number One, which I have always kept. I would try to find out, so, if this was a person of true understanding. But, whoever it was, he, or she, would always say:\n\n\"That is a hat.\"\n\nThen I would never talk to that person about boa constrictors, or primeval forests, or stars. I would bring myself down to his level. I would talk to him about bridge, and golf, and politics, and neckties. And the grown-up would be greatly pleased to have met such a sensible man. ','2021-06-22 15:37:46'),(2,'The North Wind and The Sun','The North Wind and the Sun had a quarrel about which of them was the stronger. While they were disputing with much heat and bluster, a Traveler passed along the road wrapped in a cloak.\n\"Let us agree,\" said the Sun, \"that he is the stronger who can strip that Traveler of his cloak.\"\n\"Very well,\" growled the North Wind, and at once sent a cold, howling blast against the Traveler.\nWith the first gust of wind the ends of the cloak whipped about the Traveler\'s body. But he immediately wrapped it closely around him, and the harder the Wind blew, the tighter he held it to him. The North Wind tore angrily at the cloak, but all his efforts were in vain.\nThen the Sun began to shine. At first his beams were gentle, and in the pleasant warmth after the bitter cold of the North Wind, the Traveler unfastened his cloak and let it hang loosely from his shoulders. The Sun\'s rays grew warmer and warmer. The man took off his cap and mopped his brow. At last he became so heated that he pulled off his cloak, and, to escape the blazing sunshine, threw himself down in the welcome shade of a tree by the roadside.\nGentleness and kind persuasion win where force and bluster fail.','2021-06-21 12:46:24'),(3,'Emma','Emma Woodhouse is clever, beautiful and rich, and loves matchmaking between her friends and neighbours in the village of Highbury. Unfortunately, she seems to create more heartache than happiness, and never thinks about her own chances of love. \"Penguin Readers\" is a series of simplified novels, film novelizations and original titles that introduce students at all levels to the pleasures of reading in English. Originally designed for teaching English as a foreign language, the series\' combination of high interest level and low reading age makes it suitable for both English-speaking teenagers with limited reading skills and students of English as a second language. Many titles in the series also provide access to the pre-20th century literature strands of the National Curriculum English Orders. \"Penguin Readers\" are graded at seven levels of difficulty, from \"Easystarts\" with a 200-word vocabulary, to Level 6 (Advanced) with a 3000-word vocabulary. In addition, titles fall into one of three sub-categories: \"Contemporary\", \"Classics\" or \"Originals\". At the end of each book there is a section of enjoyable exercises focusing on vocabulary building, comprehension, discussion and writing. Some titles in the series are available with an accompanying audio cassette, or in a book and cassette pack. Additionally, selected titles have free accompanying \"Penguin Readers Factsheets\" which provide stimulating exercise material for students, as well as suggestions for teachers on how to exploit the Readers in class.','2021-06-21 12:46:37'),(4,'크리스마스 캐롤','The tale begins on Christmas Eve seven years after the death of Ebenezer Scrooge\'s business partner Jacob Marley. Scrooge is established within the first stave (chapter) as a greedy and stingy businessman who has no place in his life for kindness, compassion, charity, or benevolence. After being warned by Marley\'s ghost to change his ways, Scrooge is visited by three additional ghosts \"each in its turn\" who accompany him to various scenes with the hope of achieving his transformation. The first of the spirits, the Ghost of Christmas Past, takes Scrooge to the scenes of his boyhood and youth which stir the old miser\'s gentle and tender side by reminding him of a time when he was more innocent. The second spirit, the Ghost of Christmas Present, takes Scrooge to several radically differing scenes (a joy-filled market of people buying the makings of Christmas dinner, the family feast of Scrooge\'s near-impoverished clerk Bob Cratchit, a miner\'s cottage, and a lighthouse among other sites) in order to evince from the miser a sense of responsibility for his fellow man. The third spirit, the Ghost of Christmas Yet to Come, harrows Scrooge with dire visions of the future if he does not learn and act upon what he has witnessed. Scrooge\'s own neglected and untended grave is revealed, prompting the miser to aver that he will change his ways in hopes of changing these \"shadows of what may be.\" In the fifth and final stave, Scrooge awakens Christmas morning with joy and love in his heart, then spends the day with his nephew\'s family after anonymously sending a prize turkey to the Crachit home for Christmas dinner. Scrooge has become a different man overnight, and now treats his fellow men with kindness, generosity, and compassion, gaining a reputation as a man who embodies the spirit of Christmas. The story closes with the narrator confirming the validity, completeness, and permanence of Scrooge\'s transformation.','2021-06-22 15:40:39'),(5,'셜록 홈즈의 모험','HarperCollins is proud to present its new range of best-loved, essential classics. \'Sherlock Holmes was transformed when he was hot upon such a scent as this. Men who had only known the quiet thinker and logician of Baker Street would have failed to recognize him. His face flushed and darkened. His brows were drawn into two hard black lines, while his eyes shone out from beneath them with a steely glitter.\' Set against the foggy, mysterious backdrops of London and the English countryside, these are the first twelve stories ever published to feature the infamous Detective Sherlock Holmes and his side kick Doctor Watson. They first appeared as stories in the Strand Magazine and feature some of his most famous and enjoyable cases, including \'A Scandal in Bohemia\', \'The Adventure of the Blue Carbuncle\' and \'The Red-headed League\'.','2021-06-22 15:40:44'),(6,'햄릿','The \"Bankside Shakespeare\" series offers the complete and unabridged text for GCSE Students. Each page includes two columns, one of the play\'s text, the other of side notes giving the meanings of difficult words and explaining the literal sense of the most complex ideas. There are also footnotes which provide further support to a full understanding of the text. This includes placing the language of the play in its historical context and referring the student to other places within the text. Synopses of the action appear at the beginning of each act and scene. Each book also contains accessible information about Shakespeare\'s life and times, the Renaissance, the staging of the plays, and background information to the key themes and particular language features of each play. The text is therefore suited both to class study and to individual work. A range of photographs from some of the most influential recent productions illustrates each book and provides stimuli for discussion of costume, staging and dramatic presentation.','2021-06-22 15:40:09'),(7,'위대한 게츠비','\'There was music from my neighbor\'s house through the summer nights. In his blue gardens men and girls came and went like moths among the whisperings and the champagne and the stars\'. Everybody who is anybody is seen at the glittering parties held in millionaire Jay Gatsby\'s mansion in West Egg, east of New York. The riotous throng congregates in his sumptuous garden, coolly debating Gatsby\'s origins and mysterious past. None of the frivolous socialites understands him and among various rumours is the conviction that \'he killed a man\'. A detached onlooker, Gatsby is oblivious to the speculation he creates, but always seems to be watching and waiting, though no one knows what for. As the tragic story unfolds, Gatsby\'s destructive dreams and passions are revealed, leading to disturbing consequences. A brilliant evocation of 1920s high society, \"The Great Gatsby\" peels away the layers of this glamorous world to display the coldness and cruelty at its heart.','2021-06-22 15:39:41'),(8,'The Mysterious Affair at Styles','The novel is set in England during World War I at Styles Court, an Essex country manor (also the setting of Curtain, Poirot\'s last case). Upon her husband\'s death, the wealthy widow, Emily Cavendish, inherited a life estate in Styles as well as the outright inheritance of the larger part of the late Mr. Cavendish\'s income. Mrs. Cavendish became Mrs. Inglethorp upon her recent remarriage to a much younger man, Alfred Inglethorp. Emily\'s two stepsons, John and Lawrence Cavendish, as well as John\'s wife Mary and several other people, also live at Styles. John Cavendish is the vested remainderman of Styles; that is, the property will pass to him automatically upon his stepmother\'s decease, as per his late father\'s will. The income left to Mrs Inglethorp by her late husband would be distributed as per Mrs. Inglethorp\'s own will.','2021-06-21 12:54:01'),(9,'투명인간','\"Penguin Readers\" is a series of simplified novels, film novelizations and original titles that introduce students at all levels to the pleasures of reading in English. Originally designed for teaching English as a foreign language, the series\' combination of high interest level and low reading age makes it suitable for both English-speaking teenagers with limited reading skills and students of English as a second language. Many titles in the series also provide access to the pre-20th century literature strands of the National Curriculum English Orders. \"Penguin Readers\" are graded at seven levels of difficulty, from \"Easystarts\" with a 200-word vocabulary, to Level 6 (Advanced) with a 3000-word vocabulary. In addition, titles fall into one of three sub-categories: \"Contemporary\", \"Classics\" or \"Originals\". At the end of each book there is a section of enjoyable exercises focusing on vocabulary building, comprehension, discussion and writing. Some titles in the series are available with an accompanying audio cassette, or in a book and cassette pack. Additionally, selected titles have free accompanying \"Penguin Readers Factsheets\" which provide stimulating exercise material for students, as well as suggestions for teachers on how to exploit the Readers in class.','2021-06-22 15:40:21'),(10,'The Count of Monte Cristo','The ultimate story of escape to riches, revenge and redemption by \'the Napoleon of storytellers\'. Falsley accused of treason, Edmond Dantes is arrested on his wedding night and imprisoned in the grim island fortress of Chateau d\'If. After staging a dramatic escape he sets out to discover the fabuouls treasure on the island of Monte Cristo and uses it to exact revenge on those responsible for his incarcaration. The sensational narrative of intrigue, betrayal, escape and triumphant revenge moves at a cracking pace. Dumas\' novels present a powerful conflict between good and evil embodied in an epic saga of rich diversity that is complicated by the hero\'s ultimate doscomfort with the hubristic implications of his own actions. A novel of enormous tension and excitement, The Count of Monte Cristo is also a tale of obsession and revenge, with Dantes, believing himself to be an Angel of Providence, pursuing his vengeance to the bitter end before realising that he himself is a victim of fate.','2021-06-21 12:54:26'),(11,'My New S